<?php

class Test_SpeedOut_DataHandler_HTMLCompressor extends Test_SpeedOut_DataHandler {

	protected function initDataHandler() {
		return new SpeedOut_DataHandler_HTMLCompressor();
	}

	public function testStripSpaces() {
		$this->assertEquals('<html></html>', $this->getHandledData('<html>

		</html>'));
	}

	public function testStripComments() {
		$this->assertEquals('<html></html>', $this->getHandledData('<html><!-- blablabla --></html>'));
	}

	public function testDontStripSystemComments() {
		$this->assertRegExp(
			'~<html>\s*' . preg_quote('<!--[if lte IE 7]>blablabla<![endif]-->', '~') . '\s*</html>~s',
			$this->getHandledData('<html><!--[if lte IE 7]>blablabla<![endif]--></html>')
		);
	}

	public function testLongJavaScriptString() {
		$longJs = '<script>var xxx = "";</script>';
		$this->assertEquals($longJs, $this->getHandledData($longJs));
	}
}
